import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import PasswordChecker from './PasswordChecker'; // Import PasswordChecker
import VideoShowcase from './Showcase'; // Import VideoShowcase

const App = () => {
    return (
        <Router>
            <div className="Start-container">
                <Routes>
                    <Route path="/" element={<PasswordChecker />} /> {/* Render PasswordChecker at root */}
                    <Route path="/showcase" element={<VideoShowcase />} /> {/* Render VideoShowcase at /showcase */}
                </Routes>

                {/* Temporary placeholder content to ensure scrolling works */}
                <div style={{ height: '200vh', padding: '20px' }}>
                    <p>This is placeholder content to create scrollable space. Scroll down to see the description fade in!</p>
                </div>
            </div>
        </Router>
    );
};

export default App;
